descripcion:
-- rhv --    hermosa casa ubicada en un ambiento excelente a 15 minutos de cuernavaca, con hermosos jardines, una recamara, cocina integral, patio, un ba&ntilde;o, sala/comedor, area de convivencia al aire libre, con asador y palapa, alberca, un lugar de estacionamiento.  
dentro del conjunto la campi&ntilde;a cuenta con parque central y capilla. se en cuenta cerca de xochitepec&nbsp;  
metros cuadadros de terreno &nbsp;65 y construidos 49
